(896, 134, 165, 7, 'Know my fear', '', '2007-01-04 00:00:00', 0000, 15, 0, 3, '', '「 台灣民主運動 改革的路途 充滿著艱難 充滿著坎坷 \n但雖然這樣 仍然前有古人 後有來者 一代一代 大家繼續來走 大家繼續來拼」\n\nCome on and feel my tear ,know my fear\nCome on and feel my tear ,know my fear\nCome on and feel my tear ,know my fear\nCome on and feel my tear ,know my fear\n\n我不屑那些垃圾終日炒作國家意識，我不屑頭頭是道結果是選舉招式，\n我不屑政客自私自利糟蹋這片土地，我不屑滿嘴仁義結果是為他自己，\n我遺憾台灣每到了選舉藍綠失去理性，沒有公理只有勝利結果是只有權力，\n我遺憾所謂菁英只顧現在不看未來，人民期待成為了等待結果是只有無奈。\n\n我真的覺得可惜，我真的覺得無力，I really feel sorry,惡性循環持續下去，\n我真的覺得可惜，我真的覺得無力，I really feel sorry,難道我無能為力，\n我真的覺得可惜，我真的覺得無力，I really feel sorry,惡性循環持續下去，\n我真的覺得可惜，我真的覺得無力，I really feel sorry,難道你沒有反應。\n\n我不屑那些垃圾終日炒作國家意識，\n我不屑政客自私自利糟蹋這片土地，\n我遺憾台灣每到了選舉藍綠失去理性，沒有公理只有勝利結果是只有權力，\n我遺憾所謂菁英只顧現在不看未來，人民期待成為了等待結果是只有無奈。\n\nCome on and feel my tear ,know my fear\nCome on and feel my tear ,know my fear\nCome on and feel my tear ,know my fear\nCome on and feel my tear ,know my fear\n\n「 台灣民主運動 改革的路途 充滿著艱難 充滿著坎坷 但雖然這樣 仍然前有古人 後有來者 一代一代 大家繼續來走 大家繼續來拼 \n我們不願相信 世間沒公道 不願相信 我們愛台灣是錯誤的 大家繼續拼」\n\nCome on and feel my tear ,know my fear\nCome on and feel my tear ,know my fear\nCome on and feel my tear ,know my fear\nCome on and feel my tear ,know my fear', 289, '', '', '', '', '', '', 1, 1, 0, '2008-03-18 21:22:26', '2015-03-12 13:30:34', '0000-00-00 00:00:00'),
