(906, 146, 0, 1, '全世界我最喜歡你（可是你都不知道。）', '把難搞妹必備歌曲。', '0000-00-00 00:00:00', 0000, 20, 0, 7, '今天天氣很好　太陽出來了　　風兒輕輕吹　　鳥兒吱吱叫\r\n你心情也很好　臉上總是笑　　笑的真可愛　　可惜不是對我笑\r\n\r\n真的好喜歡你　真希望你知道　寫一首歌給你　又害怕你聽到\r\n\r\n全世界我最喜歡你　可是你都不知道\r\n因為你不喜歡我你比較喜歡睡覺\r\n全世界我最喜歡你　可是你都不知道\r\n我會提醒　你起床尿尿　拜託你喜歡我好不好？\r\n\r\n你說我像流氓　　我衝去買刮鬍刀　你說你有點肉　沒關係我送你減肥藥\r\n反正那都不重要　那都不重要　　小妞我好喜歡你　這比較重要\r\n\r\n真的好喜歡你　希望你明瞭　唱首歌給你聽　大聲到你聽到\r\n\r\n全世界我最喜歡你　可是你都不知道\r\n因為你有點笨不知道我心在發燒\r\n全世界我最喜歡你　可是你都不知道\r\n我會對你　很好非常好　拜託你喜歡我好不好？\r\n\r\n全世界我最喜歡你　你都不知道\r\n你有點笨我知道　笨笨的很好\r\n全世界我最喜歡你　可是你都不知道\r\n我的青春　在為你燃燒　拜託你喜歡我好不好？', '', 274, '', '鄭焙隆', '鄭焙隆', '', '', '', 1, 0, 0, '2008-03-19 14:48:34', '2015-03-12 13:30:34', '0000-00-00 00:00:00'),
(907, 146, 0, 1, '全世界我最喜歡你（一起加油吧！）', '跟難搞的女朋友在一起太久適時反省一下！', '0000-00-00 00:00:00', 0000, 20, 0, 7, '沒有你的溫柔 我怎麼會知道 我也可以很重要\r\n沒有你的擁抱 我怎麼會知道 用力適當就好\r\n沒有你的眼淚 我怎麼會知道 我的體貼愈來愈少\r\n沒有過那麼久 我怎麼會知道 你真的比較喜歡睡覺\r\n\r\n仍然想要為你唱一首歌\r\n仍然想要在冬天裡擁抱\r\n仍然想要注視你的微笑\r\n仍然想要你感覺到\r\n\r\n沒有我的無聊 你怎麼會知道 你是多麼喜歡笑\r\n沒有我的情緒 你怎麼會知道 有些問題我解決不了\r\n沒有我的反覆 你怎麼會知道 想要放棄就得趁早\r\n沒有過那麼久 你怎麼會知道 在一起就是一起變老\r\n\r\n仍然想要為你唱一首歌\r\n仍然想要在冬天裡擁抱\r\n仍然想要注視你的微笑\r\n仍然想要你感覺到\r\n\r\n我的愛 那麼少 親愛的 全部給你 一起加油吧', '', 146, '', '鄭焙隆', '鄭焙隆', '', '', '', 1, 0, 0, '2008-03-19 14:57:21', '2015-03-12 13:30:34', '0000-00-00 00:00:00'),
(908, 148, 0, 1, '何處通往', '我們首次成功的開發出屬於我們自己的元素,可以說是東方式的,中國式的,而且絕對不俗氣.\r\n在何處通往裡頭,你可以聽到極度重金屬Riff,東方迷幻民謠旋律,前衛/趣味節奏(我們的鼓手Jose the "maricone"),由個人切身課題出發,遊走到對芸芸眾生的關切,以及對你我的禱言.\r\n\r\n\r\n如果大家看過"Wanted"這部電影,\r\n就能感受這首創作.\r\n由其在發展中國家,更能看清楚這種問題.\r\n很多人卻忽略\r\n而我們能做就是把它寫出來,唱出來\r\n\r\n\r\n', '0000-00-00 00:00:00', 0000, 15, 1, 7, '藍色粉末刺穿我\r\n 放大視野 我凝視著\r\n 悲傷就此遠離\r\n 幸福滅殺所有 我\r\n 誰說安穩就是好\r\n 憤怒和反抗與我們\r\n\r\n 同在 與我們同在\r\n 存在 依然存在\r\n \r\n 肩膀上怪獸操縱去向\r\n 為何不感到恐慌?\r\n 為何不感到恐慌?\r\n 訓獸師誘餌配放\r\n 無差別揮鞭控場\r\n 老鼠爭相逃竄討賞\r\n 堅持與我們\r\n\r\n 同在 與我們同在\r\n 存在 依然存在\r\n\r\n 安穩 便利 嚮往 生活\r\n 撲殺 我們 自由\r\n 剝削 工人 自由\r\n\r\n 誰願看清這尋常\r\n 無處可藏\r\n 何處通往\r\n 誰又能夠去遺忘\r\n 窗口天堂\r\n make love and peace forever', '', 279, '', '', '', '', '', '', 0, 0, 1, '2008-03-19 15:48:33', '2013-10-07 17:11:36', '0000-00-00 00:00:00'),
