(910, 152, 0, 2, 'Say hello!!!', '', '0000-00-00 00:00:00', 0000, 15, 1, 10, 'Say Hello!!!\r\n曲：Ian&amp;Tzara 詞：Tzara 編曲：FLAT CLUB\r\n \r\n噢\r\n如今你愣在轉角\r\n十一點鍾座標\r\n再不轉向恐怕船就要觸礁\r\n \r\n噢\r\n所以別投鼠忌器\r\n自顧不暇緊張\r\n扭扭捏捏結結巴巴語焉不詳\r\n \r\nSay Hello Honey\r\nSay Hello lovey\r\nSay Hello Baby\r\nSay Hello sweetie\r\n \r\n現在你沒時間考慮面子要往哪掛\r\n看著你的心神不寧舉棋不定的心\r\n越來越無法招架\r\n \r\n(廢話我也不想多嘮叨)\r\n可是你拐彎抹角\r\n面有難色尷尬\r\n欲言又止一點也不瀟灑大方\r\n \r\n噢\r\n還是想懸崖勒馬\r\n矜持不可自拔\r\n眼高手低吞吞吐吐失措慌張\r\n \r\nSay Hello Honey\r\nSay Hello lovey\r\nSay Hello Baby\r\nSay Hello sweetie\r\n \r\n \r\n現在你沒時間考慮面子要往哪掛\r\n看著你的心神不寧舉棋不定的心\r\n越來越無法自拔\r\n \r\n \r\nso\r\n所以你懂嗎\r\n現在的樣子啊\r\n在節骨眼上不計形象的跨\r\n會是最後的贏家\r\nso\r\n所以你懂嗎\r\n現在的樣子啊\r\n在節骨眼上不計形象的跨\r\n就是最後贏家\r\n \r\n', '', 311, '', 'IAN', 'Tzara', 'FLAT CLUB', '', '', 0, 0, 1, '2008-03-19 17:01:01', '2013-10-07 17:11:36', '0000-00-00 00:00:00'),
