(914, 152, 0, 4, '68 dogs day', '', '0000-00-00 00:00:00', 0000, 15, 1, 7, '68 Dogs Day\r\n曲：IAN　詞：Tzara 編曲 FLAT CLUB\r\n \r\n\r\n把臉躺在柏油路面\r\n把斑馬線看成古柯鹼\r\n上膛的彈夾\r\n和Pick項鍊\r\n頑強的舌尖\r\n在琴弦上呻吟詩篇\r\n \r\n赭色的蟑螂也振翅高飛\r\n發霉的猶太麵包教人軟黏\r\n《嘔吐》式存在主義傳染無謂\r\n槍砲、病菌與鋼鐵無止盡永劫回歸\r\n \r\n無政府的狂癲\r\n無神論的妄言\r\n別讓青春的肉體再犧牲浪費\r\n彈孔痕跡能說明一切\r\n \r\n把臉躺在柏油路面\r\n把斑馬線看成古柯鹼\r\n蘇聯坦克終結了那年春天\r\n愛之夏嬉皮少年捧著鮮花嚷著宣言\r\n \r\n於是68年的學運革命場景\r\n缺席的人只能在戲院悼念\r\n藍儂的身影變成件件T-Shirt\r\n蘇維埃的小說冰冷冷地躺在書櫃\r\n \r\n無政府的狂癲\r\n無神論的妄言\r\n別讓青春的肉體再犧牲浪費\r\n針孔痕跡能忘記一切\r\n \r\n \r\nOhh\r\nRight Now\r\nNow\r\nWhatever you shoot\r\nAnd Cheers! Now!\r\nNow\r\nBe swinged away\r\nThe Dogs day\r\n只做愛不作戰\r\n就加入活死人世界多荒謬的謊言\r\n \r\nNow\r\nNow\r\nWhatever you Shout\r\nAnd Cheers! Now!\r\nNow\r\nBe swinged away\r\nThe Dogs day\r\n只做愛不作戰\r\n就吐出氤氳大麻煙圈然後視而不見\r\n\r\n', '', 282, '', 'IAN', 'Tzara', '', '', '', 0, 0, 1, '2008-03-19 17:19:01', '2013-10-07 17:11:36', '0000-00-00 00:00:00'),
