(918, 152, 0, 5, 'don''t let me', '', '0000-00-00 00:00:00', 0000, 15, 1, 7, 'Don’Let me \r\n詞：Tzara 曲:Tzara/Ian 編曲：FLAT Club \r\n\r\n \r\nDon’t let me Know\r\nWhat Pain is For\r\nDon’t Let me Float\r\nFive minutes slow\r\n \r\nBut close your eye\r\nAnd Hold it tight\r\nWhere nothing is fine\r\nAnd it’s all Life \r\n \r\nGave him gaze to bounce the ball strike all your viand\r\nTill the world the child was in list should be hidden\r\nAnd my music fade out you still feel Land dry\r\nRolling stone decay on the ground became High\r\n \r\n \r\nDon’t let me Know\r\nWhat Pain is For\r\nDon’t Let me fall\r\nFrom Broken Home\r\n \r\nThis career is mine?\r\nNobody sign\r\nWhere nothing is fine\r\nAnd it’s all Life \r\n \r\nGave him gaze to bounce the ball strike all your viand\r\nTill the world the child was in list should be died\r\nAnd my music fade out you still feel them dry\r\nRolling stone decay on the ground became High\r\n \r\nWaste the time\r\nWaste the time\r\nWaste the time\r\nWaste the time\r\n \r\n(SOLO)\r\n \r\nDon’t let me Know\r\nWhat Pain is For\r\nDon’t Let me Float\r\nFive minutes slow\r\n \r\nBut close your eye\r\nAnd Hold it tight\r\nWhere nothing is fine\r\nAnd it’s all Life \r\n \r\nGave him gaze to bounce the ball strike all your viand\r\nTill the world the child was in list should be hidden\r\nAnd my music fade out you still feel Land dry\r\nRolling stone decay on the ground became High\r\n \r\nIN nightmare dream\r\nI decide\r\nHardly try\r\nThe boat was sucked\r\n \r\nIN nightmare dream\r\nI decide\r\nHardly try\r\nmelted in the sun\r\n \r\n \r\nWaste the time\r\nWaste the time\r\nWaste the time\r\nWaste the time\r\n', '', 347, '', 'Tzara/IAN', 'Tzara', 'FLAT CLUB', '', '', 0, 0, 1, '2008-03-19 17:27:56', '2013-10-07 17:11:36', '0000-00-00 00:00:00'),
