(920, 152, 0, 6, '遣悲懷', '', '0000-00-00 00:00:00', 0000, 15, 1, 7, '遣悲懷\r\n詞：Tzara 曲：Ian 編曲：FlatClub\r\n\r\n再一次我又開始慢慢依賴\r\n囓咬我\r\n再抱緊我\r\n千萬別醒過來\r\n用青春釀的體液將我灌溉\r\n充滿我\r\n再撞擊我\r\n千萬別停下來\r\n在這荒涼的年代\r\n動不動就遣悲懷\r\n也無須問神怎麼辦\r\n \r\n現在開始\r\n只有虛無觀值得依賴\r\n麻醉我\r\n再槍決我\r\n好讓我痛快\r\n用妳最骯髒的手段將我侵占\r\n你懂不懂\r\n為何我心跳澎湃\r\n \r\n在這荒涼的年代\r\n動不動就遣悲懷\r\n也無須問神怎麼辦\r\n \r\n也別按捺心中的搔癢難耐\r\n和我一起\r\n一起感到天旋地轉\r\n也別按捺心中的搔癢難耐\r\n和我一起\r\n一起感到天旋地轉\r\n \r\n是我不應該這樣投降\r\n是我不應該這樣投降\r\n不自待\r\n在妳裙擺\r\n \r\n再一次我又開始慢慢依賴\r\n囓咬我\r\n再抱緊我\r\n千萬別醒過來\r\n用青春釀的體液將我灌溉\r\n你懂不懂\r\n為何我心跳澎湃\r\n', '', 335, '', 'IAN', 'Tzara', 'FLAT CLUB', '', '', 0, 0, 1, '2008-03-19 17:36:16', '2013-10-07 17:11:36', '0000-00-00 00:00:00'),
(921, 152, 0, 7, '不要假裝', '', '0000-00-00 00:00:00', 0000, 15, 1, 7, '不要假裝\r\n曲：IAN 詞:Tzara 編曲:FLAT CLUB\r\n\r\n背著破背包現在就出發\r\n忘掉狗屁倒灶莫名奇妙的事\r\n甩掉了公司\r\n甩掉了城市\r\n自由空氣比起冷氣更加舒適 \r\n有同伴也好\r\n一個人也好\r\n一包香煙一罐啤酒天涯海角 \r\n打開玻璃窗\r\n蔚藍海岸線 \r\n(我的)公路電影搖滾記事正在上演　 \r\n\r\n該怎麼說　\r\n該怎麼說\r\n這種放縱的感覺好久沒有\r\n等著你　等著我　前方還有什麼\r\n不去想　不去管　面對鏡頭\r\n不用假裝　大聲合唱　一首沒押韻的歌 ', '', 250, '', 'IAN', 'Tzara', 'FLAT CLUB', '', '', 0, 0, 1, '2008-03-19 17:42:36', '2013-10-07 17:11:36', '0000-00-00 00:00:00'),
