(924, 152, 0, 8, '一切的一切', '', '0000-00-00 00:00:00', 0000, 15, 1, 7, '一切的一切（N45）\r\n曲：IAN 詞：Tzaralin 編曲：FLAT CLUB\r\n\r\n\r\n從來也沒有設身處地\r\n從來也沒有看清楚\r\n從來也沒有真心了解\r\n從來也沒有對(都不會)\r\n \r\n再多解釋也了無所謂\r\n我們在虛擬的城市\r\n每天針鋒相對 \r\n \r\n現在底開始 就不要爭辯\r\n現在底開始 也不要信誰\r\n現在底開始 也不用跟隨\r\n現在底開始 更不要妥協\r\n \r\n最後的一切\r\n一切的一切\r\n回過神沒發現螢幕外的世界\r\n什麼都沒改變\r\n', '', 204, '', 'IAN', 'Tzara', 'FLAT CLUB', '', '', 0, 0, 1, '2008-03-19 17:48:15', '2013-10-07 17:11:37', '0000-00-00 00:00:00'),
