(931, 148, 0, 1, 'Breathe Out Only (Another Ver.)', '一首轉型的點\r\n\r\n帶往我們邁向另一個空間  \r\n\r\n學習 發掘 .......................... \r\n\r\n就是這首歌所回饋給我們的\r\n\r\n', '0000-00-00 00:00:00', 0000, 15, 1, 7, 'Feeling separately\r\nFrom the out and the in\r\nStaring at the whole\r\nAs you see \r\nI''m in pain slowly\r\n\r\nSo tell me ! What''s meant to be?\r\nIf there''s no choice left for me?\r\nRun away, Or here to stay\r\nHow could you don''t even care?\r\nIn these memory we shared\r\nStar lights in the wind\r\nburn my skin\r\nWhat''ve you promised\r\nbecame my prayer...\r\n\r\nThere''s a whisper in my ear\r\nFiltering sadness into your blood\r\nThrough your dim eyes I can feel\r\nIt''s hard to see \r\nPlease don''t turn your back on me...\r\n\r\nBurn my skin as you see\r\nWhere to go?\r\nWhat to be?', '', 405, '', '', '', '', '', '', 1, 1, 0, '2008-03-19 18:56:52', '2015-03-12 13:30:34', '0000-00-00 00:00:00'),
(932, 148, 0, 2, '交易夢的碎片', 'Underflow所有歌曲中完成速度最快的一首\r\n然而它是建立在這首歌曲的前身,魯拉的一篇文章之上.\r\n我們是站在魯拉的肩膀上才得以完成交易夢的碎片.\r\nhow do you explain the psychedelical tune of the song?\r\n認識我們的朋友,可能會很訝異,Underflow竟然做了這麼不灰暗,甚至是顯的光明的抒情歌\r\n那就請你回頭去想上面的那個問題吧\r\ngood bye,blue skyyyyyyyyyyyyyyyyyyyyyyyyyyyyyyyy!!\r\n\r\n\r\n\r\n\r\n', '0000-00-00 00:00:00', 0000, 15, 1, 7, '震動,為何無聲無息?\r\n\r\n我承受,為什麼不?\r\n\r\n我給,誰收?\r\n\r\n交易夢的碎片,卻看不見\r\n\r\n看不見的表情\r\n\r\n與妳分享 那些深刻印記\r\n\r\n光線\r\n\r\n躍過你我\r\n\r\n成為紀念\r\n\r\n撿拾\r\n\r\n夢的旅人\r\n\r\n可曾清醒\r\n\r\n卻拼湊無限空白\r\n\r\n在妳眼中 是否空白?\r\n', '', 284, '', '', '', '', '', '', 0, 0, 1, '2008-03-19 19:01:04', '2013-10-07 17:11:37', '0000-00-00 00:00:00'),
