(960, 162, 0, 3, 'Dreamy Pie', '雖然世界很扭曲，充滿謊言欺騙與針刺，但還是要努力活下去!', '0000-00-00 00:00:00', 0000, 15, 1, 7, 'I am drowned in Vodka lime;\r\nSeeing world with blurry eyes\r\nCut up my care and put in delights\r\nFloating like a feather in the sky\r\n\r\nDizzily dreamily high\r\nI''m lying on the heaven\r\nPack up my pride and Marlboro Lights\r\nLiving life in rocking style\r\n\r\nWhy should I always be mature?\r\nWhy can''t I just stay pure?\r\n\r\nHe is drawing in my eyes;\r\nStaying up with fuzzy sight\r\nAll my glamour and vanity\r\nis floating like a feather, yeah\r\nDizzily dreamily high\r\nI''m lying on the heaven\r\nPack up my pride and Marlboro Lights\r\nLiving life in rocking style\r\n\r\nWhy should I always follow your rules?\r\nWhy can''t I just stay pure?\r\n\r\nI know I can’t do it, but I just wanna try... \r\nI know I can do it...\r\n', '', 375, '', '', 'juju', '', '', '', 0, 0, 1, '2008-03-20 00:55:18', '2013-10-07 17:11:37', '0000-00-00 00:00:00'),
(961, 162, 0, 2, 'Everlasting', '許下一個承諾,並且努力去實現它...............', '0000-00-00 00:00:00', 0000, 15, 1, 7, '', '', 349, '', 'juju', 'juju', 'alluvial', '', '', 0, 0, 1, '2008-03-20 00:59:50', '2013-10-07 17:11:37', '0000-00-00 00:00:00'),
(962, 162, 0, 5, '擦掉橡皮擦', '怎麼洗也洗刷不掉的,除了摧毀殆盡之外,似乎也沒有其他的選擇了.....', '0000-00-00 00:00:00', 0000, 0, 1, 7, '我擦掉虛偽謊言　只留下空白的臉\r\n失去色彩　畫面　要怎麼才抹滅\r\n指尖留著餘味　細碎飄零的滋味\r\n不需要再辯解　無關是白還是黑\r\nI can''t get over it\r\n\r\n思緒漸漸墜落，意識被掩沒\r\n視線漸漸薄弱，言語變沉默\r\nerase me! 用血液　無聲回應\r\n無痕跡 沒指印 純白如新\r\n痛楚漸漸微弱，殘忍且寂寞\r\n心臟仍在跳動，明顯而清晰\r\n不停止!不停止!無法安靜!\r\nerase me! 不停止!無法安靜!\r\n\r\nI can''t get over it...', '', 550, '', '小愛', '小愛', '', '', '', 1, 0, 0, '2008-03-20 01:05:34', '2015-03-12 13:30:35', '0000-00-00 00:00:00'),
(963, 162, 0, 5, 'psycho! psycho!', '「有人說我瘋了，但問題是，瘋狂算不算是最高等的智慧？大部分的瘋狂是不是燦爛輝煌的？有沒有可能說，瘋狂的深奧面其實並非來自思想的病態，而是來自心靈情緒狀態的提升，只不過代價是犧牲了一般的智力？」　　　　－　愛倫坡(Edgar Allan Poe)\r\n', '0000-00-00 00:00:00', 0000, 15, 0, 7, 'I struggled against pains, then twisted and lost myself. Get outta my head!!\r\nI struggled against pains, I wish you disappear just like the smoke\r\nright away get away from me, right away. Get away from me. \r\n\r\nyou said that I''m freaky. oh maybe I''m a psycho crabby piggy\r\nall your words are about grumbling. full of anger inside my head, \r\nand inside your brain\r\nI don''t think you like my life absolutely, oh \r\nI don''t think this is a devoted relationship, hell no!\r\n\r\nI struggled against pains, then twisted and lost myself. Get outta my head!!\r\nI struggled against pains, I wish you disappear just like the smoke\r\nright away get away from me, right away. Get away from me. \r\n\r\nyou said that I''m paranoid. oh yes!!! I''m a psycho crabby piggy.\r\nI seek pleasure through the dark. full of liquor inside my head, \r\nor inside my brain\r\nI don''t mean to ruin my life absolutely, oh\r\nbut lonesome feeling''s blinding my soul, and crashing me down, hell no!', '', 314, '', 'juju', 'juju', '', '', '', 0, 0, 1, '2008-03-20 01:08:38', '2013-10-07 17:11:37', '0000-00-00 00:00:00'),
