(1010, 128, 154, 10, 'Today', '', '2007-05-14 00:00:00', 0000, 12, 0, 1, '', 'And today\r\nI will kill myself\r\nAnd today\r\nMy heart will stop running\r\nAnd today\r\nI will leave the world behind me\r\nAnd today\r\nI will lose you forever\r\n\r\nAnd today, yeah\r\nOh today, yeah\r\nOh, today the world is mine\r\n\r\nMother hold me\r\nHold me tight\r\n\r\nI will leave you', 404, '', '', '', '', '', '', 1, 1, 0, '2008-03-20 18:39:23', '2015-03-12 13:30:37', '0000-00-00 00:00:00'),
